import { Component, EventEmitter, OnInit, Output } from '@angular/core';
import { Camera, CameraResultType } from '@capacitor/camera';
import { Platform } from '@ionic/angular';

@Component({
  selector: 'app-photo-picker',
  templateUrl: './photo-picker.component.html',
  styleUrls: ['./photo-picker.component.scss'],
})
export class PhotoPickerComponent implements OnInit {

  @Output() selectImage: EventEmitter<string> = new EventEmitter<string>();

  constructor(private _platform: Platform) { }

  ngOnInit() {}

  public onSelectImage() {
    if (!this._platform.is('hybrid')) {
      console.log('it isn\'t available');
      this.selectImage.emit("data:image/jpeg;base64,");
    } else {
      Camera.getPhoto({
        quality: 60,
        allowEditing: true,
        resultType: CameraResultType.Base64,
      }).then(photo => {
        console.log('======================= SUCCESSS PHOTO =======================')
        console.log(photo.base64String);
        this.selectImage.emit("data:image/jpeg;base64," + photo.base64String);
      }).catch(err => {
        console.log('======================= ERROR PHOTO =======================')
        console.log(err);
      });
    }
  }
}
